	//"show_tag": "2",
	//"content": "<p>浣熊只在繁殖期才会成对。公浣熊会同时与几头母熊交配，但母熊一般只接受一位求偶者。平时温驯安详的公熊在交配季节常常会互相叫嚷和厮打。<span style=\"font-size: 12px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; margin-left: 2px; color: rgb(51, 102, 204); cursor: default; padding: 0px 2px;\">[2]</span><a style=\"color: rgb(19, 110, 194); position: relative; top: -50px; font-size: 0px; line-height: 0;\" name=\"ref_[2]_17339\"></a>&nbsp;</p><p>浣熊的交配季节为1或2月，妊娠期是63～65天，每年生产一次，在4或5月产下幼子（受天气影响），一胎3～7个，但通常是4个。其一般住在<a target=\"_blank\" href=\"http://baike.baidu.com/view/143352.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">树</a>洞、地洞或<a target=\"_blank\" href=\"http://baike.baidu.com/view/2007410.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">山洞</a>中。幼仔夏末就能断奶，然后开始独立生活。浣熊并不<a target=\"_blank\" href=\"http://baike.baidu.com/view/21758.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">冬眠</a>，但严寒的冬季会匿藏起来。<span style=\"font-size: 12px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; margin-left: 2px; color: rgb(51, 102, 204); cursor: default; padding: 0px 2px;\">[2]</span><a style=\"color: rgb(19, 110, 194); position: relative; top: -50px; font-size: 0px; line-height: 0;\" name=\"ref_[2]_17339\"></a>&nbsp;</p><p>浣熊一般只能生活几年，野生的已知最长寿命为12年。</p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"6\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub17339_6\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"别称由来\"></a></p><h2 class=\"para-title level-2\" style=\"margin: 35px 0px 15px -30px; padding: 0px; font-size: 24px; color: rgb(51, 51, 51); border-left-width: 12px; border-left-style: solid; border-left-color: rgb(79, 156, 238); font-family: &#39;Microsoft YaHei&#39;, SimHei, Verdana; font-weight: 500; line-height: 22px; clear: both; zoom: 1; overflow: hidden; position: relative; white-space: normal; background: url(http://baike.bdimg.com/static/wiki-lemma/normal/resource/img/paraTitle-line_c5e6d61.png) rgb(255, 255, 255);\"><span class=\"title-text\" style=\"font-size: 22px; color: rgb(0, 0, 0); line-height: 24px; display: block; float: left; padding: 0px 8px 0px 18px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">别称由来</span><a class=\"edit-icon j-edit-link\" data-edit-dl=\"6\" style=\"color: rgb(136, 136, 136); display: block; float: right; height: 22px; padding-left: 24px; font-size: 12px; font-family: SimSun; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"font-family: baikeFont_layout; -webkit-font-smoothing: antialiased; speak: none; line-height: 1; outline: 0px; margin: 0px 3px 0px 0px; vertical-align: text-bottom; color: rgb(170, 170, 170);\"></span>编辑</a></h2><p><a target=\"_blank\" href=\"http://baike.baidu.com/view/243035.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">小浣熊干脆面</a>曾伴随很多人度过难忘的童年，包装袋上的<a target=\"_blank\" href=\"http://baike.baidu.com/view/112983.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">小浣熊</a><a target=\"_blank\" href=\"http://baike.baidu.com/view/918459.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">憨态可掬</a>，形象各异，令人喜爱。鉴于小浣熊干脆面超强的“群众基础”，于是不少人又将小浣熊称之为“干脆面君”。</p><p>但已证明包装袋上的并不是浣熊，而是属于食肉目小熊猫属的动物，主要分布在中国南部以及不丹、印度、老挝、缅甸、尼泊尔等周边国家，以竹笋、果实和昆虫为主食。由于它的长相与浣熊相似，而且也有吃东西之前洗一洗的习惯，所以经常容易被误认为是浣熊。关于这两种动物坚持“洗洗更健康”的原因，目前还没有定论。其实这两种动物只是体型大小和生活习惯相似，其他的各方面，如前爪和吻部的形态等还是有很多区别的。</p><p><span style=\"font-size: 12px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; margin-left: 2px; color: rgb(51, 102, 204); cursor: default; padding: 0px 2px;\">[7-8]</span><a style=\"color: rgb(19, 110, 194); position: relative; top: -50px; font-size: 0px; line-height: 0;\" name=\"ref_[7-8]_17339\"></a>&nbsp;</p><p><img class=\"imglib_img\" src=\"https://q-cdn.mtq.tvm.cn/Public/user-uploads/images/20151231/1451538984-129717.jpg\" title=\"1451538984-129717.jpg\" alt=\"f4272dc5e5b05f83543ae03bb853aff3.jpg\"/></p><p><br/></p>",
